import React, {useState} from "react"
import {
    Switch,
    Route
  } from "react-router-dom";
import '../css/main.css';
import Navbar from './MainComponents/Navbar'
import Inventory from './MainComponents/Inventory'

const Main = (props) =>{
    
    return(
        <div id="main">
            <Navbar />
            <div className="main-content">
                <Switch>
                    <Route exact path={["/main","/main/inventory"]} component={Inventory} />
                </Switch>
            </div>
        </div>
    )        
}

export default Main;
